import "../../App.css";
import CardGlass from "../card_glass";

export default function SignUp() {
  return (
    <div className="section-SignUp">
      <video src="/videos/video-2.mp4" autoPlay loop muted />
      <CardGlass title="Entre e Acesse sua Conta!" />
    </div>
  );
}
